import React,{useState} from 'react';


const Prop = () => {
  const state=useState
  const [count,counti]=useState(50);
  const inc=()=>{
    counti(count+1);

  }
  return (
    <>
       
        <div className="flex flex-col justify-center items-center min-h-screen">
        <h1 className="font-bold text-3xl">{count}</h1>
  <button onClick={inc} className="bg-blue-500 rounded-lg px-11 py-11 m-3 border-4 border-gray-950">Click Me!</button>
</div>
    </>
  )
}

export default Prop
